import React from 'react';
import Button from 'react-bootstrap/Button'

function Topbar(){
    return(
        <nav>
            <a href='#'>Link1</a>
            <a href='#'>Link2</a>
            <a href='#'>Link3</a>
            <Button variant="info">Info</Button>
        </nav>
    );
}

export default Topbar;
